import React from "react";
import Linechart from './../LineChart/LineChart';
import Circularprogressbar from './../CircularProgressBar/CircularProgressBar';
export default function Portfolio(props) {
  return (
    <div>
      <div style={{ display: "flex" }}>
        <Circularprogressbar />
        <div>
            <div>
            {props.value.heading}
            </div>
            <div style={{display:"flex"}}>
                <div>
                    
                    <Linechart />
                </div>
            </div>
        </div>
        </div>
    </div>
  );
}
